import classes from './MyForm.module.css';
import { useState, useRef } from 'react';

const MyForm = () => {

  const [toggleFlag, setToggleFlag] = useState(false);


  const firstNameref = useRef();
  const lastnameRef = useRef();
  const emailRef = useRef();
  const passwordRef = useRef();


  const data = [];

  const submitHandler = (event) => {
    event.preventDefault();
    setToggleFlag(true);
    const FirstName = firstNameref.current.value;
    const LastName = lastnameRef.current.value;
    const Email = emailRef.current.value;
    const Password = passwordRef.current.value;
    data = [{
      firstName: FirstName,
      lastName: LastName,
      email: Email,
      password: Password
    }]
  }



  return (
    <div className="App">
      {!toggleFlag && <form className={classes.form} onSubmit={submitHandler} >
        <div className={classes.control}>
          <label htmlFor='email'><h2>My Details</h2></label>
        </div>
        <div className={classes.control}>
          <label htmlFor='email'>First Name</label>
          <input type='text' required ref={firstNameref} />
        </div>
        <div className={classes.control}>
          <label htmlFor='email'>Last Name</label>
          <input type='text' required ref={lastnameRef} />
        </div>
        <div className={classes.control}>
          <label htmlFor='email'>Email</label>
          <input type='text' required ref={emailRef} />
        </div>
        <div className={classes.control}>
          <label htmlFor='email'>Password</label>
          <input type='text' required ref={passwordRef} />
        </div>
        <div className={classes.action}>
          <button>Submit</button>
        </div>
      </form>}
      {toggleFlag && <div>
        <table>
          <tr>
            <th>FirstName</th>
            <th>LastName</th>
            <th>Email</th>
            <th>Password</th>
          </tr>
          {data.map((val, key) => {
            return (
              <tr key={key}>
                <td>{val.firstName}</td>
                <td>{val.lastName}</td>
                <td>{val.Email}</td>
                <td>{val.Password}</td>
              </tr>
            )
          })}
        </table>
      </div>}
    </div>
  );
}

export default MyForm;
